import * as React from 'react'
import '../../../styles/components/intro.scss'

export {Intro}

function Intro() {
  return (
    <div>
    <div className="c-intro--background"/>
    <div className="c-intro">Hi, I'm Lillian Liebman</div>
    <div className="c-intro">Software developer and passionate follower of all things web, </div>
    <div className="c-intro">Welcome to my website!</div>
  </div>)
}
